        const map = L.map('map').setView([41.58, -71.45], 10);
        L.tileLayer('https://{s}.basemaps.cartocdn.com/dark_all/{z}/{x}/{y}{r}.png', {
            attribution: '¬© OpenStreetMap, ¬© CARTO'
        }).addTo(map);
        
        function priceColor(price) {
            if (price >= 1000000) return '#4B2C5E';
            if (price >= 750000) return '#00E1E6';
            if (price >= 500000) return '#f59e0b';
            if (price >= 300000) return '#10b981';
            return '#06b6d4';
        }
        
        function priceRange(price) {
            if (price >= 1000000) return 'over1m';
            if (price >= 750000) return '750to1m';
            if (price >= 500000) return '500to750';
            if (price >= 300000) return '300to500';
            return 'under300';
        }
        
        const markers = L.layerGroup().addTo(map);
        let currentData = P;
        
        function renderMarkers(data) {
            markers.clearLayers();
            data.forEach(p => {
                const color = priceColor(p.price);
                const m = L.circleMarker([p.lat, p.lng], {
                    radius: 6,
                    fillColor: color,
                    color: '#0f172a',
                    weight: 1,
                    fillOpacity: 0.85
                });
                m.bindPopup(`
                    <strong>${p.addr}</strong><br>
                    ${p.city}, RI<br>
                    <strong style="color:${color};font-size:1.1em">$${p.price.toLocaleString()}</strong><br>
                    ${p.type}<br>
                    ${p.beds} bed, ${p.baths} bath<br>
                    ${p.url ? `<a href="${p.url}" target="_blank" style="color:#2E1A47">View on Redfin ‚Üí</a>` : ''}
                `);
                markers.addLayer(m);
            });
            document.getElementById('count').textContent = data.length.toLocaleString();
        }
        
        function filterByPrice() {
            const priceVal = document.getElementById('priceFilter').value;
            const typeVal = document.getElementById('typeFilter').value;
            
            let filtered = P;
            
            // Price filter
            if (priceVal === 'under300') filtered = filtered.filter(p => p.price < 300000);
            else if (priceVal === '300to500') filtered = filtered.filter(p => p.price >= 300000 && p.price < 500000);
            else if (priceVal === '500to750') filtered = filtered.filter(p => p.price >= 500000 && p.price < 750000);
            else if (priceVal === '750to1m') filtered = filtered.filter(p => p.price >= 750000 && p.price < 1000000);
            else if (priceVal === 'over1m') filtered = filtered.filter(p => p.price >= 1000000);
            
            // Type filter
            if (typeVal === 'land') filtered = filtered.filter(p => p.type.includes('Land'));
            else if (typeVal === 'single') filtered = filtered.filter(p => p.type.includes('Single'));
            else if (typeVal === 'condo') filtered = filtered.filter(p => p.type.includes('Condo'));
            else if (typeVal === 'multi') filtered = filtered.filter(p => p.type.includes('Multi'));
            
            currentData = filtered;
            renderMarkers(filtered);
        }
        
        function toggleLabels() {
            // Future: add price labels on hover
        }
        
        // Initial render
        renderMarkers(P);
